	double aStartTime = omp_get_wtime();

	int* aRandomNumbers = new int[NUMBER_OF_RANDOMS];

	for (int i = 0; i < aNumberOfRandoms; i++) {
		aRandomNumbers[i] = rand();
		cout << "Thread:" << omp_get_thread_num() <<  " Index:" << i << " Random: " << rand() << endl;
	}


	double anEndTime = omp_get_wtime();

	cout << "Time Taken:" << anEndTime - aStartTime << endl;

	return aRandomNumbers;


}

void random_sequential_main() {
	int* aRandomNumbers = random(NUMBER_OF_RANDOMS);
	printIntArray(aRandomNumbers, NUMBER_OF_RANDOMS);
}

