/**
 * an array to learn how much concurrency occurred
 */
int MAX_THREADS = 100;
double* threadsLastIndex = new double[MAX_THREADS];
int numThreads;

//void printIntArray (int* anArray, int aSize) {
//	cout << "Int Array:" << endl;
//	for (int i = 0; i < aSize; i++) {
//		cout << " Index:" << i << " Value: " << anArray[i] << endl;
//	}
